import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, InputBase, Typography, Grid, Avatar, Box, ThemeProvider, createTheme, styled, Divider } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import axios from 'axios';
import ProfileCard from './profilecard'; 

const apiUrl = 'https://mocki.io/v1/ddb7e0a8-e218-4e36-b1be-b902cdb1c098';

const theme = createTheme({
  typography: {
    fontFamily: [
      'Poppins',
      'Arial',
      'sans-serif'
    ].join(','),
  },
});

// StyledInputBase component to customize the InputBase
const StyledInputBase = styled(InputBase)({
  backgroundColor: 'white',
  borderRadius: 20, // Adjust the value as per your requirement for the roundness
  paddingLeft: 10,
  '& input': {
    color: 'black', // Text color
  },
});


const StyledProfileCard = styled(ProfileCard)({
  borderRadius: 10,
  boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)', // Box shadow
  padding: '10px',
  display: 'flex',
  alignItems: 'center',
});

const UserDetails = () => {
  const [users, setUsers] = useState([]);
  const [admins, setAdmins] = useState([]);
  const [members, setMembers] = useState([]);

  useEffect(() => {
    axios.get(apiUrl)
      .then(response => {
        const allUsers = response.data;
        setUsers(allUsers);
        const adminUsers = allUsers.filter(user => user.role === 'administrator');
        const memberUsers = allUsers.filter(user => user.role === 'member');
        setAdmins(adminUsers);
        setMembers(memberUsers);
      })
      .catch(error => {
        console.error('Error fetching user details:', error);
      });
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <div>
        <AppBar position="static" sx={{ background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)' }}>
          <Toolbar>
            <Typography variant="h6">
              User Details
            </Typography>
            <Box sx={{ flexGrow: 1 }} />
            <StyledInputBase
              placeholder="Search…"
              startAdornment={<SearchIcon style={{ color: 'black' }} />}
              sx={{ pl: 6 }}
            />
          </Toolbar>
        </AppBar>
        <Grid container spacing={3} marginTop={2}>
          <Grid item xs={12}>
            <Typography variant="h5" gutterBottom>
              Administrators
            </Typography>
            <Divider />
            {admins.map(user => (
              <StyledProfileCard key={user.email}>
                <Avatar src={user.img} sx={{ width: 60, height: 60, marginRight: 2 }} />
                <Box>
                  <Typography variant="h6" fontWeight="bold">{user.first_name} {user.last_name}</Typography>
                  <Typography variant="body1" color="textSecondary">{user.email}</Typography>
                </Box>
              </StyledProfileCard>
            ))}
          </Grid>
          <Grid item xs={12}>
            <Typography variant="h5" gutterBottom>
              Members
            </Typography>
            <Divider />
            {members.map(user => (
              <StyledProfileCard key={user.email}>
                <Avatar src={user.img} sx={{ width: 60, height: 60, marginRight: 2 }} />
                <Box>
                  <Typography variant="h6" fontWeight="bold">{user.first_name} {user.last_name}</Typography>
                  <Typography variant="body1" color="textSecondary">{user.email}</Typography>
                </Box>
              </StyledProfileCard>
            ))}
          </Grid>
        </Grid>
      </div>
    </ThemeProvider>
  );
};

export default UserDetails;
